import React from "react"
import Calc from "../calctor"
import Userlist from "../userlist"
import {connect} from "react-redux"
import {indexAction,userAction} from "../store/actionCreators"
class List extends React.Component{
    render(){
        const {display1,display2,indexAction,userAction}=this.props
        console.log(display1,display2)
        let jsx1=display1==="block"?<Calc/>:""
        console.log(jsx1)
        let jsx2=display2==="block"?<Userlist/>:""    
        return(  
            <div>
                <div className="lists">
                    <div></div>
                    {/* // eslint-disable-next-line */}
                    <div onClick={indexAction} className={display1==="block"?"blue":"index1"}>首页</div>
                    <div></div>
                    {/* // eslint-disable-next-line */}
                    <div onClick={userAction} className={display2==="block"?"blue":"sale1"}>收入分析</div>
                    <div></div>
                </div>
                    {/* 是否显示计算器组件 */}
                    {<Calc/>}
                    {/* 是否显示用户列表组件 */}
                    {jsx2}
            </div>
        )        
    }
}
const stateToProps=(state)=>{
    return{
        display1:state.display1,
        display2:state.display2
    }
}
const dispatchToProps={
    indexAction,
    userAction
}
export default connect(stateToProps,dispatchToProps)(List)
